import * as React from "react";
import { AppData } from "./appdata";

const SkillInfo = props => {
  let { state, dispatch } = React.useContext(AppData);
  const tabdata = this.props.tabdata;
  return (
    <React.Fragment>
      {tabdata.map((data, index) => {
        return (
          <p key={index} className="can-edit">
            <strong>
              {data.name} [{data.years} years]:
            </strong>
            <span dangerouslySetInnerHTML={{ __html: data.info }}></span>
          </p>
        );
      })}
    </React.Fragment>
  );
};

export default SkillInfo;
